import logo from './logo.svg';
import './App.css';
import GlobalApi from './GlobalApi';
import BookList from './bookList';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";



function App() {

  return (
    <div className="App">
      <button onClick={GlobalApi.baseInfoUpload}>Upload</button>
      <BrowserRouter>
        <Routes path="/">
          <Route index element={<BookList></BookList>}></Route>
        </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
